import React from 'react';

const CardListItem = props => {
    return (
      <li>
        <div
          className="card-container"
          style={{
            width: "50%",
            border: "solid 3px #d3d3d3",
            margin: "10px auto"
          }}
        >
          <img src={props.data.image} />
          <p>
            <strong>{props.data.name}</strong>
          </p>
        </div>
      </li>
    );
  };

export default CardListItem;
